import * as React from 'react';
import { StyleSheet } from 'react-native';
import EditScreenInfo from '../components/EditScreenInfo';
import { Text, View } from '../components/Themed';
import axios from 'axios';

interface Genres {
  [index: string]: string
}

interface Genre {
  GenresofChoice: Genres;
}

export default function TabTwoScreen() {

  const [genres, setGenres] = React.useState<any | object>({})

  React.useEffect(() => {
    // const result = await axios();
    axios.get('https://tenderfy.herokuapp.com/genres')
    .then(res => {
      // console.log(res.data["0"]["Genres"])
      setGenres(res.data)
    })
  }, [])

  if(Object.keys(genres).length > 0) {
    console.log(genres["0"]["Genres"])
  }

  return (
    <View style={styles.container}>
      {Object.keys(genres).length > 0 ? genres.map((genre: Genres) => (
        <Text style={styles.title}>{genre}</Text>
      )) : <Text>Hi</Text>}
      <Text>{Object.keys(genres).length > 0 ? genres["0"]["Genres"] : "Nothing"}</Text>
      <View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
